export default function TableCsv() {
  const [data, setData] = useState<any>([]);

  let tableRows = null;

  if (data) {
    const tableRows = <tr>
      {data.map((datum: string, index: number) => {
        return (
          <td key={index}>
            {datum}
          </td>
        );
      })}
    </tr>
  }

  useEffect(() => {
    readRemoteFile('/alkoholilupa_toimipaikkatiedot_34.csv', {
      complete: (results: any) => {
        console.log('Results:', results)
        setData(results)
      }
    });
  }, [])

  return (
    <div className="card ">
      <table>
        <thead>
          <tr>
            <th>#</th>
          </tr>
        </thead>
        <tbody>
          {tableRows}
        </tbody>
      </table>
      <div className="card-header">
        <h4 className="card-title"> Simple Table</h4>
        {typeof (data.columns)}
        {(data.columns)}
        {/* {data.length > 0 ? data[0] : ''} */}
      </div>
      <div className="card-body">
        <div className="table-responsive">
          <table className="table tablesorter " id="">
            <thead className=" text-primary">
              <tr>
                {data.columns && data.columns.map((name: string, i: number) => (
                  <th key={i}>name</th>
                ))}
                <th>Country</th>
                <th>City</th>
                <th className="text-center">Salary</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Dakota Rice</td>
                <td>Niger</td>
                <td>Oud-Turnhout</td>
                <td className="text-center">$36,738</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  )
}

